<?php

namespace Appleton\Taxes\Seeds\US\Alabama;

use Appleton\Taxes\Countries\US\Alabama\SulligentOccupational;
use DB;
use Illuminate\Database\Seeder;

class SulligentSeeder extends Seeder
{
    public function run()
    {
        $id = DB::table(config('taxes.governmental_unit_areas'))->insertGetId([
            'name' => 'Sulligent, AL',
            'area' => '',
        ]);

        DB::table(config('taxes.tax_areas'))->insert([
            'name' => 'Sulligent Occupational Tax',
            'tax' => SulligentOccupational::class,
            'governmental_unit_area_id' => $id,
        ]);
    }
}
